            <text>იყიდება იდეალურ მდგომარეობაში TOYOTA CENTER TEGETA-დან გამოყვანილი Toyota Rav 4/ჰიბრიდი. მანქანა გამოშვებულია მაისის თვეში და ცენტრიდან გამოვიყვანე ივლისში. ყველაფერი მუშაობს გამართულად. ავარია არ მომსვლია არასდროს, შესაბამისად არაფერი აქვს მანქანას გამოცვლილი. ყველანაირ გეგმიურ სერვისს გადიოდა ტოიოტას ცენტრში. წვავს 6 ლიტრს, არის ძალიან ეკონომიური და კომფორტული მანქანა. მანქანას მოყვება ზამთრის, ასევე სათადარიგო საბურავი და ცენტრის აქსესუარებსაც მოვაყოლებ. 
